const NavButtons =
[
    {
        title: "Home",
        icon: "Home-Icon",
        value: "home",
    },
    {
        title: "Contacts",
        icon: "contact-icon",
        value: "contacts"
    }
];

export const Navbar = (props) =>
{
    return (
    <div className="container--navbar">
        { NavButtons.map((aNavButtonInfo) =>
        {
            const { title, icon, value } = aNavButtonInfo;
            return (
                <div onClick={() => props.handleSelectTab(value) }>
                    <img src={icon} alt={title}/>
                </div>
            );
        })}
    </div>
    );
};
